import React from 'react';

export default class Classcpt extends React.Component() {
    constructor(props) {
        super(props)
        this.state = {
            count: 0
        }
    }
    render() {
        return(
            <>
                <h2>Class component</h2>
                <button>+1</button>
                <button>Reset</button>
                <h3>Count: </h3>
            </>
        )
    }
}
